style.css:
@-moz-document domain("youtube.com") {
/* 
        YouTube - PornHub Logo Style
        by valnoxy - https://valnoxy.dev

        Changelog:
        --------------------------------------------------
        v1.0.0 (02.10.2022)
        - Initial release
    */

    #logo-red-icon,
    #logo-icon {
        content: url("data:image/png;base64,") !important;
        background-image: none !important;
        width: 102px;
        height: 29px;
    }

    html[dark] #logo-icon,
    html[dark] #logo-red-icon {
        content: url("data:image/png;base64,") !important;
        background-image: none !important;
    }
}
